import React from 'react';
import { Link } from 'react-router-dom';
import Png from '../../assets/images/logos/logo.png';
import '../../assets/styles/EmployeeDash.css';

class EmployeeDash extends React.Component{
    render(){
        return(
            <div>
                <div className="eDash-top">
                    <header className="header" style={{backgroundColor:'#000000'}}>
                        <nav className="navbar">
                            <div className="eDash-top-left" style={{marginLeft:'20px'}}>
                                <Link to="/"> 
                                    <img className="left-png" src={Png} alt="Brand-Logo"/>
                                </Link>
                            </div> 
                            <div className="eDash-top-right">  
                                <ul class="nav nav-pills admin-links">
                                    <li class="nav-item">
                                        <p class="nav-link active btn-sm" href="#">Employee Calendar</p>
                                    </li>
                                    <li class="nav-item">
                                        <p class="nav-link active btn-sm" href="#">Team View</p>
                                    </li>
                                    <li class="nav-item">
                                        <p class="nav-link active btn-sm" href="#">New Absence</p>
                                    </li>
                                </ul>

                                <button type="button" class="btn btn-danger lg">Log Out</button> 
                            </div>                   
                        </nav>                
                    </header>
                </div>
                <div className="eDash-body"></div>
                <div className="eDash-foot"></div>

            </div>
        );
    }
}
export default EmployeeDash;
